#IwANNAbeANNA CONTEST - Create your own look inspired by ADR's iconic style - Take a picture of your look and post it on Instagram using the hashtag #IwANNAbeANNA - Tag 3 friends who love fashion in your post - On feb 15th, The ADR Jury will select the best/most creative and crazy look - The winner will be invited to the star-studded #ADRBOOKBeyondFashion event on February 24 in Milan
- The AdR archive will go on sale via Christie's and NET-A-PORTER
- All proceeds will go to charity to help young designers who want to study fashion
